import React from 'react'
import { BsCheck } from 'react-icons/bs'
import cn from 'classnames'

const Check = ({isCompleted, changeTodo}) => {
  return (
    <div onClick={() => changeTodo(todo.id)} className= {cn(`border-2 rounded-lg border-pink-400  w-6 h-6 mr-3 flex items-center justify-center cursor-pointer`, 
    {'bg-pink-400' : isCompleted})}> 
        {isCompleted && <BsCheck size={24} className="text-gray-900"/>}
    </div>
  )
}

export default Check
